import React from 'react';
import { Link, Routes, Route, HashRouter } from 'react'
import Home from './Home';

export default function Navigation() {
return (
    <HashRouter basename="/">
        <Routes>
            <Route path="/" element={<Home />} />
        </Routes>
    </HashRouter>
)

}
